import React from 'react';
import './App.css';
import Header from './components/Header.js';
import Slider from  './components/Slider.js';
import Info from './components/Info.js'



function App() {
  return (
    <div>
      <Header/>

      <div style={{marginBottom: "2.6rem"}}>
        <Slider />
      </div>

      <Info/>
      </div>
  );
}




export default App;
